import React from 'react';
import './Welcome.css';

function Welcome() {
    return(
        <div className="welcome">
            <text><span>Hi, I'm Julian!</span></text>
            <text><span>I design and develop software.</span></text>
        </div>
    );
}

export default Welcome;
